$font-secondary: "Varela Round", sans-serif;

* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
  }
  
  body {
    background-color: #eee;
    overflow-x: hidden;
  }
  
  header {
    background-color: #252525;
    height: 53px;
  }
  
  .header-container {
    width: 942px;
    margin: 0 auto;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
  }
  
  .header-logo {
    display: flex;
    align-items: center;
  
    h1 {
      color: #fff;
      font-family: $font-primary;
      font-size: 24px;
      font-weight: 400;
      width: 100px;
      padding-left: 9px;
    }
  
    .logo-container {
      background-color: #303030;
      width: 63px;
      height: 53px;
  
      img {
        width: 14px;
        height: 21px;
        position: relative;
        top: 15px;
        left: 23px;
      }
    }
  }
  
  .header-search-box {
    display: flex;
    align-items: center;
  }
  
  .search-inputs {
    display: none;
  }
  
  .header-search-box {
    input {
      background-color: #333;
      border: none;
      padding: 10px;
      margin-right: 10px;
    }
  
    select {
      margin-right: 10px;
      background-color: #333;
      color: #fff;
      padding: 10px;
      font-family: $font-secondary;
    }
  
    .search-icon-container {
      background-color: #303030;
      width: 63px;
      height: 53px;
      cursor: pointer;
  
      img {
        width: 16px;
        height: 16px;
        position: relative;
        top: 18px;
        left: 23px;
      }
    }
  }
  
  nav {
    background-color: #4d4382;
    height: 53px;
  
    ul {
      display: flex;
      width: 942px;
      margin: 0 auto;
    }
  
    li {
      list-style-type: none;
      width: auto;
      height: 53px;
      text-align: center;
      padding: 15px 21px 14px 20px;
  
      &:hover {
        background-color: #299EC3;
        height: 53px;
        border-bottom: none;
      }
    }
  
    .active {
      background-color: #299EC3;
      height: 53px;
      border-bottom: none;
    }
  
    a {
      color: #fff;
      text-decoration: none;
      font-family: $font-primary;
      font-size: 18px;
      font-weight: 700;
      font-style: normal;
    }
  }
  
  .nav-business {
    border-bottom: #EE6151 6px solid;
  }
  
  .nav-sport {
    border-bottom: #84C14F 6px solid;
  }
  
  .nav-life {
    border-bottom: #5DCFF3 6px solid;
  }
  
  .nav-tech {
    border-bottom: #FCC44D 6px solid;
  }
  
  .nav-travel {
    border-bottom: #A99765 6px solid;
  }
  
  #menu-icon {
    display: none;
  }
  
  .banner-big {
    display: block;
    width: 940px;
    margin: 16px auto 0 auto;
    height: 120px;
    background-color: #fff;
    border: 1px solid #d7d7d7;
  
    p {
      font-family: $font-secondary;
      color: #999999;
      text-align: center;
      font-size: 14px;
      line-height: 16px;
      width: 90px;
      margin: 40px auto;
    }
  }
  
  .carousel-container {
    width: 940px;
    height: 425px;
    margin: 0 auto 19px auto;
  }
  
  .arrow {
    position: relative;
    cursor: pointer;
    z-index: 2;
  }
  
  .arrow-left {
    top: 50%;
    margin-top: -35px;
    margin-left: 20px;
  }
  
  .arrow-right {
    left: 95%;
    top: 40%;
  }
  
  .slide-content {
    position: absolute;
    overflow-x: hidden;
    z-index: 1;
  
    .news-image {
      width: 940px;
      height: 425px;
      padding-bottom: 19px;
    }
  }
  
  .slide-info {
    position: absolute;
    z-index: 2;
    bottom: 23px;
    margin: 28px;
  
    span {
      font-family: $font-secondary;
      color: #eef6fa;
      font-size: 12px;
      padding-top: 20px;
    }
  
    h1 {
      font-family: $font-primary;
      color: #eef6fa;
      font-size: 34px;
      font-weight: 700;
      line-height: 40.8px;
    }
  
    button {
      font-family: $font-secondary;
      font-size: 14px;
      padding: 9px 20px;
      background: none;
      border: 1px solid #fff;
      color: #eef6fa;
    }
  }
  
  .slide-date {
    padding-left: 0;
  }
  
  main {
    width: 942px;
    margin: 0 auto;
    display: flex;
    justify-content: center;
    flex-direction: row;
  }
  
  .news-image {
    object-fit: cover;
    background-size: cover;
  }
  
  .news-container {
    background-color: #fff;
    width: 625px;
    height: 325px;
    border-left: 13px solid #3677b5;
    margin: 0 17px 17px 0;
  
    .news-header {
      display: flex;
      justify-content: space-between;
      padding: 15px 30px;
  
      h2 {
        font-family: $font-primary;
        font-size: 24px;
        color: #363f48;
        font-weight: 700;
        width: 94px;
      }
  
      a {
        font-family: $font-secondary;
        color: #3677b5;
        font-size: 14px;
        padding-top: 15px;
      }
    }
  
    .news-box-container {
      display: flex;
      flex-direction: row;
      padding: 10px;
  
      .news-box {
        padding: 10px;
  
        img {
          width: 179px;
          height: 128px;
        }
  
        p {
          font-family: $font-secondary;
          font-size: 12px;
          display: inline;
          line-height: 14px;
          font-weight: 400;
        }
      }
  
      span {
        font-family: $font-secondary;
        font-size: 12px;
        display: inline;
        line-height: 14px;
        font-weight: 400;
      }
  
      .news-box {
        h3 {
          font-family: $font-primary;
          font-size: 14px;
          font-weight: 700;
          line-height: 16.8px;
        }
  
        span {
          float: right;
        }
      }
    }
  }
  
  .sport {
    border-left: 13px solid #84c14f;
    margin-bottom: 19px;
  }
  
  .business {
    border-left: 13px solid #EE6151;
    height: auto;
  
    .news-box-container {
      display: grid;
      grid-template-columns: repeat(2, 1fr);
      padding: 38px 12px 29px 31px;
    }
  
    .news-header {
      padding-bottom: 0;
    }
  
    .business-box {
      img {
        width: 120px;
        height: 90px;
        float: left;
        margin-bottom: 30px;
      }
  
      h3 {
        font-family: $font-primary;
        font-size: 14px;
        font-weight: 700;
        line-height: 16.8px;
        width: 154px;
        float: right;
        margin-bottom: 30px;
      }
  
      p {
        font-family: $font-secondary;
        color: #999999;
        font-size: 12px;
        line-height: 14.45px;
        font-weight: 400;
        padding-left: 130px;
      }
    }
  }
  
  .banner-small {
    display: block;
    width: 623px;
    height: 123px;
    background-color: #fff;
    border: 1px solid #d7d7d7;
    margin-bottom: 17px;
    margin-right: 16px;
  
    p {
      font-family: $font-secondary;
      color: #999999;
      text-align: center;
      font-size: 14px;
      line-height: 16px;
      width: 90px;
      margin: 40px auto;
    }
  }
  
  .news-carousel-container {
    background-color: #fff;
    width: 612px;
    height: 325px;
    border-left: 13px solid #fcc44d;
    margin: 10px 17px 17px 0;
  }
  
  .news-carousel-header {
    display: flex;
    justify-content: space-between;
  
    h2 {
      height: 33px;
      font-size: 24px;
      font-family: $font-primary;
      padding: 15px 30px;
      font-weight: 700;
    }
  }
  
  .arrow-right-yellow {
    padding-top: 28px;
    padding-right: 28px;
  }
  
  .arrow-left-yellow {
    padding-right: 14px;
  }
  
  .news-carousel-container-box {
    display: flex;
    margin-left: 30px;
  
    img {
      width: 260px;
      height: 150px;
    }
  
    h3 {
      font-family: $font-primary;
      font-size: 14px;
      font-weight: 700;
      line-height: 16.8px;
    }
  
    p {
      font-family: $font-secondary;
      color: #999999;
      font-size: 12px;
    }
  }
  
  .news-carousel-box {
    width: 266px;
    height: 219px;
    margin: 30px 30px 0 0;
  }
  
  .editorials-local-news-container {
    display: flex;
  }
  
  .editorials-container, .local-container {
    background-color: #fff;
    width: 297px;
    height: auto;
    border-left: 13px solid #a99765;
  }
  
  .editorials-header, .local-header {
    display: flex;
    justify-content: space-between;
    padding: 15px 31px 31px 31px;
  }
  
  .editorials-header h2, .local-header h2 {
    height: 33px;
    font-size: 24px;
    font-family: $font-primary;
  }
  
  .arrow-left-brown {
    padding-right: 12px;
    padding-top: 7px;
  }
  
  .arrow-right-brown {
    padding-top: 7px;
  }
  
  .editorial-box, .local-box {
    margin: 0 30px 30px 30px;
  }
  
  .editorial-box img, .local-box img {
    width: 230px;
    height: 150px;
  }
  
  .editorial-box h3, .local-box h3 {
    font-family: $font-primary;
    font-size: 14px;
    font-weight: 700;
    line-height: 16.8px;
    margin-right: 10px;
  }
  
  .editorial-box p, .local-box p {
    font-family: $font-secondary;
    color: #999999;
    font-size: 12px;
    font-weight: 400;
    line-height: 14.45px;
    padding-top: 9px;
  }
  
  .local-container {
    margin-left: 17px;
  }
  
  aside {
    .aside-news {
      width: 303px;
      height: auto;
      background-color: #4d4382;
    }
  
    .aside-header {
      background-color: #3e3668;
      display: flex;
      justify-content: space-evenly;
  
      a {
        color: #fff;
        text-decoration: underline;
        font-family: $font-secondary;
        padding: 18px;
        font-size: 14px;
  
        &:hover {
          color: #fcc44d;
        }
      }
    }
  
    .aside-box {
      display: flex;
      flex-direction: row;
      justify-content: space-evenly;
      align-items: center;
      border-bottom: 1px solid #000;
  
      .info {
        margin: 35px 0px 24px 32px;
      }
  
      p {
        font-family: $font-secondary;
        font-weight: 400;
        font-size: 10px;
        line-height: 12.04px;
        color: #ACB3BA;
      }
  
      span {
        float: right;
        color: #ACB3BA;
        font-size: 10px;
        position: relative;
        bottom: 30px;
        margin-right: 20px;
        margin-top: 30px;
      }
  
      h2 {
        font-family: $font-primary;
        font-weight: 700;
        font-size: 14px;
        line-height: 16.8px;
        color: #fff;
        width: 172px;
      }
  
      .news-img {
        width: 70px;
        height: 70px;
        border: 1px solid #fff;
        background-size: cover;
        object-fit: cover;
        margin: 20px 33px 0 0;
      }
  
      &:hover {
        cursor: pointer;
        background-color: #3e3668;
      }
    }
  
    .banner-group {
      background-color: #ddd;
      display: flex;
      justify-content: space-evenly;
      align-items: center;
      margin: 18px 0px;
  
      .banner-xs {
        background-color: #fff;
        margin-top: 20px;
        margin-bottom: 20px;
        width: 128px;
        height: 128px;
  
        p {
          font-family: $font-secondary;
          color: #999999;
          text-align: center;
          font-size: 14px;
          line-height: 16px;
          width: 90px;
          margin: 40px auto;
        }
      }
    }
  }
  
  .carousel2 {
    display: flex;
    flex-direction: column;
    justify-content: flex-end;
    cursor: pointer;
  
    .carousel-container {
      width: 940px;
      height: 400px;
      margin: 18px auto 19px auto;
  
      .carousel-background {
        position: absolute;
        z-index: -1;
      }
      .carousel-2-slide {
        width: 940px;
        height: 400px;
        object-fit: cover;
        background-size: cover;
        background-position: center;
      }
    }
  
    .carousel-arrows {
      margin: 30px;
      display: flex;
      justify-content: space-between;
      position: relative;
      top: 100px;
    }
  }
  
  .carousel-images-row {
    text-align: center;
    margin-top: 150px;

    .images-row-img {
      width: 120px;
      height: 120px;
      object-fit: cover;
      background-size: cover;
    }
  }
  
  footer {
    border-top: 25px solid #4d4382;
    background-color: #252525;
    height: 992px;
  }
  
  .footer-wrapper {
    width: 942px;
    margin: 0 auto;
    height: auto;
  }
  
  .footer-container {
    display: flex;
    flex-direction: row;
    justify-content: space-evenly;
  }
  
  .footer-box {
    margin-top: 57px;
    margin-bottom: 84px;
  
    p {
      color: #666;
      font-size: 14px;
      width: 303px;
      padding-bottom: 23px;
      font-family: $font-primary;
      line-height: 20px;
    }
  }
  
  .box-header {
    display: flex;
    align-items: center;
    color: #45b0e3;
    font-family: $font-primary;
    font-size: 29.62px;
    font-weight: 400;
    font-style: normal;
    padding-bottom: 21px;
    line-height: 16px;
  
    img {
      padding-right: 18px;
    }
  }
  
  .footer-box2 {
    width: 313px;
    color: #666;
    margin: 70px 17px 69px 18px;
  
    h1 {
      color: #ccc;
      font-size: 24px;
      font-family: $font-primary;
    }
  
    p {
      padding: 25px 0;
      font-family: $font-primary;
      font-size: 14px;
    }
  
    input {
      background-color: #333;
      border: none;
      width: 193px;
      height: 53px;
      font-family: $font-secondary;
      font-size: 16px;
      padding: 15px 72px 19px 21px;
    }
  
    button {
      background-color: #4d4382;
      color: #cccccc;
      border: none;
      width: 112px;
      height: 53px;
      font-size: 16px;
      font-family: $font-secondary;
      padding: 15px 14px 19px 21px;
    }
  }
  
  .footer-box3 {
    width: 303px;
    margin-top: 70px;
    margin-bottom: 64px;
  
    h1 {
      color: #ccc;
      font-size: 24px;
      font-family: $font-primary;
      padding-bottom: 31px;
    }
  
    a {
      display: inline-block;
      background-color: #333333;
      color: #575757;
      padding: 4px 12px 4px 13px;
      margin: 3px 1px;
      text-decoration: none;
      font-family: $font-secondary;
      font-size: 12px;
      line-height: 20px;
  
      &:hover {
        background-color: #4d4382;
        color: #ccc;
      }
    }
  }
  
  .footer-container-2 {
    display: flex;
    flex-direction: row;
    height: auto;
  
    h1 {
      font-family: $font-primary;
      font-size: 24px;
      line-height: 29px;
      color: #fff;
      padding-bottom: 25px;
      line-height: 29px;
      font-weight: 700;
      font-style: normal;
    }
  }
  
  .footer-box4, .footer-box5, .footer-box6 {
    width: 303px;
    margin-bottom: 63px;
  }
  
  .footer-box4, .footer-box5 {
    margin-right: 18px;
  }
  
  .box {
    display: flex;
    height: 98px;
  
    &:nth-child(odd) {
      border-top: 1px solid #666;
      border-bottom: 1px solid #666;
      mix-blend-mode: normal;
    }
  
    img {
      margin: 20px 4px 25px 0px;
      border: 1px solid #fff;
      width: 70px;
      height: 70px;
    }
  }
  
  .box-info {
    padding-top: 18px;
  
    p {
      color: #666;
      font-size: 10px;
      font-family: $font-secondary;
    }
  }
  
  .number-span {
    float: right;
    width: 36px;
    height: 12px;
    position: relative;
    bottom: 10px;
  }
  
  .box-info h2 {
    font-family: $font-primary;
    color: #ccc;
    font-size: 14px;
    font-weight: 700;
    line-height: 17px;
    font-style: normal;
    padding-bottom: 24px;
  }
  
  .footer-box6 {
    width: 303px;
  
    a {
      display: inline-block;
      background-color: #333333;
      color: #575757;
      padding: 4px 9px;
      margin: 3px;
      text-decoration: none;
      font-family: $font-secondary;
      padding: 4px 12px 4px 13px;
      margin: 3px 1px;
      font-size: 12px;
      line-height: 20px;
  
      &:hover {
        background-color: #4d4382;
        color: #ccc;
      }
    }
  }
  
  .footer-bottom {
    border-top: 3px solid #333;
  }
  
  .footer-bottom-container {
    width: 942px;
    margin: 0 auto;
    display: flex;
    justify-content: space-between;
    color: #999;
    font-family: $font-secondary;
    font-size: 12px;
    padding-top: 19px;
    height: 150px;
  }
  
  /*# sourceMappingURL=style.css.map */
